import React from 'react';


function Video(prop) {
  const videoId = getVideoIdFromUrl(prop.videoObj.url); // Assuming exampleResponse contains your video data

  return (
<div>
              {/* Display your video content here */}
              <h5>{prop.videoObj.title}</h5>
              <iframe
                width="100%"
                height="200"
                src={`https://www.youtube.com/embed/${videoId}`}
                title="YouTube video player"

              ></iframe>
</div>
  );
}

export default Video;
function getVideoIdFromUrl(url) {
  const videoId = url.split("v=")[1];
  return videoId;
}
